INSERT INTO `craft_content` (`id`, `elementId`, `locale`, `title`, `field_heading`, `field_body`, `field_price`, `field_tagline`, `field_fullName`, `field_hours`, `field_phoneNumber`, `field_streetAddress`, `field_reservationNote`, `field_caption`, `field_metaDescription`, `field_hideComments`, `field_disqusId`, `field_newsUrl`, `field_bio`, `field_givingLink`, `field_givingText`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('2', '2', 'en_us', 'Homepage', 'Welcome to Mamnoon.craft.dev!', '<p>It’s true, this site doesn’t have a whole lot of content yet, but don’t worry. Our web developers have just installed the CMS, and they’re setting things up for the content editors this very moment. Soon Mamnoon.craft.dev will be an oasis of fresh perspectives, sharp analyses, and astute opinions that will keep you coming back again and again.</p>', '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'modern union of lebanese, syrian, persian cuisines.  lebanese and syrian street foods.  ', '0', NULL, NULL, NULL, '', '<p>as generosity and compassion are a staple in levantine culture, giving back is an integral part of what we do at mamnoon.  Since our November 2012 opening, the mamnoon community has donated over $25,000 to the people and culture who provide the inspiration for all that we do.  Through our Khobz for Syria and newly launched Muskarat for Syria campaigns, glassybaby sales, individual donations, and private events, we strive to cultivate a spirit of appreciation and collective growth.</p>', '2014-07-23 17:37:16', '2015-10-15 18:36:54', '28d384bf-59ab-4795-92c5-3b16965072ec');
