INSERT INTO `craft_content` (`id`, `elementId`, `locale`, `title`, `field_heading`, `field_body`, `field_price`, `field_tagline`, `field_fullName`, `field_hours`, `field_phoneNumber`, `field_streetAddress`, `field_reservationNote`, `field_caption`, `field_metaDescription`, `field_hideComments`, `field_disqusId`, `field_newsUrl`, `field_bio`, `field_givingLink`, `field_givingText`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('133', '134', 'en_us', 'i-x9xHm2v 1280', NULL, '<p>The manou\'she is a very common street food found in every Damascus and Beirut street, often made fresh in the same (furn) bakery that supplies the pita daily bread to the neighborhood. Ingredients are basically flour, water, salt, olive oil and za\'atar. Simple, fresh, but when put together with the right skill, the results are magical experiences of taste and texture. This is a centuries old tradition that until now has not been easy to experience in Seattle; one that we grew up with and missed terribly. We believe you will have the same magical experience when you have your first mano\'ushe.</p>', '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, '2014-07-23 19:58:02', '2014-07-23 20:34:56', '864595b1-e04d-4f18-8fbe-d5e9c543bd23');
