INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `num`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('153', '467', '6', '1', 'en_us', '5', '', '{\"typeId\":\"6\",\"authorId\":\"400\",\"title\":\"Caf\\u00e9 Blanc\",\"slug\":\"caf\\u00e9-blanc\",\"postDate\":1406670480,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"2\":\"<p>At the end of every meal at mamnoon, we serve all our guests a small carafe of Caf\\u00e9 Blanc or \\u201cwhite coffee\\u201d to cap off their meal and facilitate digestion.  Known was \\u201cAhweh Bayda\\u201d in Arabic, Caf\\u00e9 Blanc is made with orange blossom extract and hot water and is sometimes sweetened with sugar or honey.  Caf\\u00e9 Blanc is thought to have originated in Lebanon and is traditionally served after meals as a digestif and offered as a sign of hospitality at special occasions and gatherings all over the Arab world.  Naturally caffeine and alcohol free, Caf\\u00e9 Blanc is also said to soothe the nerves and aid with stomach aches.  Many Middle Eastern mothers will also give their colicky babies a small amount of orange blossom extract with water.<\\/p><p>When making Caf\\u00e9 Blanc at home, remember that a little bit goes a long way.  We like ours alongside a sweet little treat like nokhochi or baklawa.<\\/p><p><strong>Caf\\u00e9 Blanc <\\/strong><\\/p><ul>\\r\\n<li>2 cups hot water<\\/li><li>1 t. orange blossom extract<\\/li><li>Sugar or honey to taste (optional)<\\/li><\\/ul>\",\"38\":[\"466\"],\"48\":\"\",\"46\":\"\",\"47\":\"\",\"39\":{\"470\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>At the end of every meal at mamnoon, we serve all our guests a small carafe of Caf\\u00e9 Blanc or \\u201cwhite coffee\\u201d to cap off their meal and facilitate digestion. Known was \\u201cAhweh Bayda\\u201d in Arabic, Caf\\u00e9 Blanc is made with orange blossom extract and hot water and is sometimes sweetened with sugar or honey. Caf\\u00e9 Blanc is thought to have originated in Lebanon and is traditionally served after meals as a digestif and offered as a sign of hospitality at special occasions and gatherings all over the Arab world. Naturally caffeine and alcohol free, Caf\\u00e9 Blanc is also said to soothe the nerves and aid with stomach aches. Many Middle Eastern mothers will also give their colicky babies a small amount of orange blossom extract with water.<\\/p><p>When making Caf\\u00e9 Blanc at home, remember that a little bit goes a long way. We like ours alongside a sweet little treat like nokhochi or baklawa.<\\/p>\"}},\"471\":{\"type\":\"recipe\",\"enabled\":\"1\",\"fields\":{\"recipeName\":\"Caf\\u00e9 Blanc\",\"ingredients\":[{\"col1\":\"2 cups\",\"col2\":\"hot water\"},{\"col1\":\"1 t.\",\"col2\":\"orange blossom extract\"},{\"col1\":\"\",\"col2\":\"sugar or honey to taste (optional)\"}],\"instructions\":\"\"}},\"472\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"469\"],\"position\":\"center\"}}}}}', '2014-09-10 17:25:39', '2014-09-10 17:25:39', '3d8eb15a-a357-484b-bcae-a0b6a4544e31');
INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `num`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('154', '468', '6', '1', 'en_us', '3', '', '{\"typeId\":\"6\",\"authorId\":\"400\",\"title\":\"The power of giving\",\"slug\":\"the-power-of-giving\",\"postDate\":1402038000,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"2\":\"<p>We are dedicated to giving back to the people and cultures that inspire all that we do at mamnoon.  Through various fundraising efforts, we have donated nearly $25,000 to the UNHCR Syrian Refugee Relief Fund to aid those displaced by the crisis in Syria and the Middle East.<\\/p><p>Our \\u2018Khobz for Syria\\u2019 campaign donates 100% of the proceeds from a $5 basket of house-made specialty breads to the UNHCR.  From the start of this project, these baskets have been one of our most popular menu items and a wonderful way for the mamnoon community to get involved with the giving effort.<\\/p><p> We are also part of a larger fundraising effort in partnership with glassybaby, a Seattle-based glass blowing studio.  Our restaurant features a \\u201cmamnoon special\\u201d glassybaby candle holder in an exclusive dark slate color.  $20 from the sale of every mamnoon glassybaby is donated to Syrian relief.<\\/p><p> The mamnoon special glassbaby is part of the larger glassybaby giving effort, a campaign that supports various charities and has donated over $2,000,000 through the sales of these beautifully simple glass candle holders.  Thedouble-glazed slate glassybaby votives, on display throughout the restaurant, are only available at mamnoon.<\\/p><p> We have also had an incredible community support through private events and individual donations.<\\/p><p>For more information on mamnoon giving, or to make a donation, call 206.906.9606 or visit http:\\/\\/www.unhcr.org\\/emergency\\/5051e8cd6-52b1c61ec.html.<\\/p>\",\"38\":[\"464\"],\"48\":\"\",\"46\":\"\",\"47\":\"\",\"39\":{\"new1\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>We are dedicated to giving back to the people and cultures that inspire all that we do at mamnoon. Through various fundraising efforts, we have donated nearly $25,000 to the UNHCR Syrian Refugee Relief Fund to aid those displaced by the crisis in Syria and the Middle East.<\\/p><p>Our \\u2018Khobz for Syria\\u2019 campaign donates 100% of the proceeds from a $5 basket of house-made specialty breads to the UNHCR. From the start of this project, these baskets have been one of our most popular menu items and a wonderful way for the mamnoon community to get involved with the giving effort.<\\/p><p>We are also part of a larger fundraising effort in partnership with glassybaby, a Seattle-based glass blowing studio. Our restaurant features a \\u201cmamnoon special\\u201d glassybaby candle holder in an exclusive dark slate color. $20 from the sale of every mamnoon glassybaby is donated to Syrian relief.<\\/p><p>The mamnoon special glassbaby is part of the larger glassybaby giving effort, a campaign that supports various charities and has donated over $2,000,000 through the sales of these beautifully simple glass candle holders. Thedouble-glazed slate glassybaby votives, on display throughout the restaurant, are only available at mamnoon.<\\/p><p>We have also had an incredible community support through private events and individual donations.<\\/p><p>For more information on mamnoon giving, or to make a donation, call 206.906.9606 or visit http:\\/\\/www.unhcr.org\\/emergency\\/5051e8cd6-52b1c61ec.html.<\\/p>\"}}}}}', '2014-09-10 17:43:49', '2014-09-10 17:43:49', '0688b4e8-f216-4494-9ebd-d202322dbbb6');
