INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `num`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('156', '468', '6', '1', 'en_us', '4', '', '{\"typeId\":\"6\",\"authorId\":\"400\",\"title\":\"The power of giving\",\"slug\":\"the-power-of-giving\",\"postDate\":1402038000,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":[\"464\"],\"48\":\"\",\"46\":\"\",\"47\":\"\",\"39\":{\"473\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>We are dedicated to giving back to the people and cultures that inspire all that we do at mamnoon. Through various fundraising efforts, we have donated nearly $25,000 to the UNHCR Syrian Refugee Relief Fund to aid those displaced by the crisis in Syria and the Middle East.<\\/p><p>Our \\u2018Khobz for Syria\\u2019 campaign donates 100% of the proceeds from a $5 basket of house-made specialty breads to the UNHCR. From the start of this project, these baskets have been one of our most popular menu items and a wonderful way for the mamnoon community to get involved with the giving effort.<\\/p><p>We are also part of a larger fundraising effort in partnership with glassybaby, a Seattle-based glass blowing studio. Our restaurant features a \\u201cmamnoon special\\u201d glassybaby candle holder in an exclusive dark slate color. $20 from the sale of every mamnoon glassybaby is donated to Syrian relief.<\\/p><p>The mamnoon special glassbaby is part of the larger glassybaby giving effort, a campaign that supports various charities and has donated over $2,000,000 through the sales of these beautifully simple glass candle holders. Thedouble-glazed slate glassybaby votives, on display throughout the restaurant, are only available at mamnoon.<\\/p><p>We have also had an incredible community support through private events and individual donations.<\\/p><p>For more information on mamnoon giving, or to make a donation, call 206.906.9606 or visit&nbsp;<a href=\\\"http:\\/\\/www.unhcr.org\\/emergency\\/5051e8cd6-52b1c61ec.html\\\" target=\\\"_blank\\\">http:\\/\\/www.unhcr.org\\/emergency\\/5051e8cd6-52b1c61ec.html<\\/a>.<\\/p>\"}},\"new1\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"474\"],\"position\":\"right\"}},\"new2\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"475\"],\"position\":\"left\"}}}}}', '2014-09-10 21:27:37', '2014-09-10 21:27:37', '7ef1650b-15f7-4f98-867d-72b6fdee6848');
