INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `num`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('166', '484', '6', '1', 'en_us', '8', '', '{\"typeId\":\"6\",\"authorId\":\"400\",\"title\":\"Art at mamnoon\",\"slug\":\"art-at-mamnoon\",\"postDate\":1401433200,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":[\"465\"],\"48\":\"\",\"46\":\"\",\"47\":\"\",\"39\":{\"485\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>Mamnoon has recently added art to our dining room to showcase artists of the Middle East and Africa. Our walls speak to the power of women, love, and seduction.<\\/p>\"}},\"486\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"479\"],\"position\":\"center\"}},\"487\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<hr id=\\\"horizontalrule\\\"><p>This image by <strong>Mouneer al Sharaani<\\/strong> can be translated to \\\"Enchantment is in the the colors, the melodies, the dew drops, the fragrances, and the flowers\\u201d. The artist is a Syrian calligrapher, designer, and print maker living and working in Cairo. Al Sharaani gave birth to a new era of contemporary Arab calligraphy through the synthesis of traditional techniques and modern styles and has received international recognition for his revitalization of the medium.<\\/p>\"}},\"488\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"480\"],\"position\":\"center\"}},\"489\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<hr id=\\\"horizontalrule\\\">\\r\\n<p>Model-turned-photographer <strong>Fabrice Monteiro<\\/strong> is an emerging artist working in the fields of photojournalism, fashion photography, and portraiture.<\\/p><p>Born to a Beninese father and Belgian mother, his childhood straddled the diverse cultural lines often represented in his work. Monteiro\\u2019s images carry the weight of modernity and tradition and force the viewer to confront the complex and often uncomfortable aesthetics of race, culture, and imperialism.&nbsp;<\\/p><p>This image from his \\u2018Signares\\u2019 series explores the role of cloth and clothing during African colonization and their subsequent meaning in an era of Westernization. Powerful Signarese women were often the \\u2018official wives\\u2019 of European colonizers for the duration of their stay. Often celebrated for their beauty and business mind, these women played an important role in the socio-economic development of Senegal.<\\/p>\"}},\"490\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"481\"],\"position\":\"left\"}},\"494\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"482\"],\"position\":\"right\"}},\"491\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>These photographs by Iranian photographer <strong>Babak Kazemi<\\/strong> are a contemporary interpretation of the legend of Shirin and Farhad.<\\/p><p>As the story goes, Farhad was a stonemason who was in love with the beautiful Shirin, who was also desired by the powerful King Khosrow.  Shirin knew of Farhad\\u2019s love and used it to make the King jealous.  King Khosrow attempted to get rid of Farhad by ordering him to complete an impossible task: to win Shirin\\u2019s hand, he must move a mountain. Farhad\\u2019s love proves to be stronger than either the King or Shirin had<\\/p><p>imagined, and he takes on the task with zeal. Amazed at the reports of Farhad\\u2019s progress, Shirin travel to the mountain to see for herself. After the long journey, though, she faints with fatigue and Farhad places both Shirin and her horse on his shoulders and carries them back to the palace. <\\/p><p>Kazemi revisits this 16th- century tragedy to comment on the contemporary struggle of lovers who must leave their homeland to find the freedom to love as they choose. For the artist, the story reveals the message that love can overcome even the most difficult situations.&nbsp;<\\/p>\"}},\"492\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"483\"],\"position\":\"center\"}},\"493\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p><strong>Hassan Hajjaj<\\/strong>, who was born in Morocco and raised in London, is a master of multiple mediums, including furniture, fashion, interior, and record album covers. Hajjaj synthesized these all into a series of sensational photo-portraits in \\u2018Kesh Angels\\u2019. These transcultural and trans-medium images depict a distinct subculture of young Moroccan women who work as henna tattoo artists and travel Marrakesh on motorbike.<\\/p><p>With pride and ease, the women pose with their bikes, wearing veils and abayas, against vivid backdrops. These photos are a jarring mix of old and new, East and West, global and local. Hajjaj plays with and upends stereotypes, presenting his subjects as both traditional and defiantly modern, which infuses his photos with electrifying tension.<\\/p>\"}}}}}', '2014-09-10 21:57:37', '2014-09-10 21:57:37', '7e60407b-b45e-48c2-aada-4f9b0a29cfe8');
