 well as getting a keen understanding of the enormous richness and value of the Levantine cultures and way of life. Essentially Dubai provided proof that the culture is exportable, welcome and adaptable to many environments.<\\/p><p>I went on to study computer science as an undergrad in Cedar Rapids, Iowa, and as a grad in Houston, Texas. I was fortunate to be studying CS at a time of great advances in the field and at the birth of the PC revolution. I went back to the middle east after my university studies.<\\/p><p>At the time, there was no real work for my skill set \\u2013 few companies needed serious programming \\u2013 so I did some sales and sales support, while I wrote programs on the side for private clients. It was an interesting mix \\u2013 on the one hand I had huge exposure to all types of people and personalities, and a work schedule that matched theirs (siesta or beach in the afternoon!), on the other I was trying to stay current with technology and make a career out of programming. A client approached me with a task: convert a program for the Mac operating system to support Arabic usage. While I was working on that I was approached by a Microsoft regional exec and eventually hired to do similar work at Microsoft \\u2013 in Seattle!  <\\/p><p>Microsoft wanted to make their products work with languages that are written and read from right to left: Arabic, Farsi, Hebrew, Urdu&hellip; While potentially large markets, Microsoft wanted to spend a minimum on R&amp;D until the revenue came in. They looked for an engineer that could do the Arabic adaptation, and then have the other languages be an easy translation. <\\/p><p>In 3 years I shipped Arabic\\/Hebrew DOS, Windows, Word for Windows before going on to work on very different projects at Microsoft.<\\/p><p>In summer of \\u201900, after a fun career at Microsoft, we moved to France to try something family oriented and different. We settled in Paris and had a full dose of joie de vie \\u2013 it was a fantastic experience, four years of discovery, fun, travel, learning and interesting work.<\\/p><p>A prominent feature in most Parisian neighborhoods is a weekly marche \\u2013 a farmers market that takes place in a designated open area. You can find amazing meat cuts, fish, fruits, veggies, cheeses, wines, baked goods and&hellip; mana\\u2019eesh. Any marche you go to will have a stall that makes saj (domed grill) mana\\u2019eesh and a variety of mezze. Cross the channel to London and Levantine food is virtually a staple \\u2013 entire high streets lined with mana\\u2019eesh, shawarama and varieties of Lebanese and Syrian restaurants. These thrive due to wide appeal to customers in their locales.<\\/p><p>My work with a startup took me back to the US in \\u201906. We had many choices of where to go, but Racha and we wanted to be back in Seattle. It just felt right. It felt like going home. We didn\\u2019t think of it as a permanent move back, rather talking about it as an \\u201cindefinite\\u201d move. The return was a great relief.<\\/p>\"}},\"501\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"496\"],\"position\":\"center\"}},\"502\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>Paris society has its cultural constraints \\u2013 because of the closeness and the density, the Lebanese groups acted Lebanese, Syrians acted Syrian, and the French acted French. There was a lot of mixing of course, but we didn\\u2019t feel there were truly hybridized communities. Seattle, like many US cities, offers a fairly big hybrid community, albeit one that doesn\\u2019t have too many Levantine cultural elements. We felt a genuine open-mindedness and ability to absorb other culture\\u2019s elements proven by how well Seattleites adopted Japanese, Thai, Vietnamese and other Asian cultures and made them part of the daily lives.<\\/p><p>Over the years we\\u2019ve expressed our cultures through a variety of ways, but the highest impact by far was when Racha prepared Lebanese, Syrian or Persian food and served at our dinners and parties.  Of course the foods are delicious and accessible and she\\u2019s an amazing cook, but the main reason has to do with the reception and the way guests are treated the <em>accueil<\\/em>.<\\/p><p>The feedback from our friends is that our cultures are welcoming, accommodating, adaptable, progressive and contemporary but more importantly they remember the visceral delicious sensations generated by eating the foods, taking in the smells and sights. There is a direct correlation between a positive visceral stimulus with an unfamiliar context, resulting in this context being familiarized in a very positive way.<\\/p><p>This was the \\u201caha\\u201d moment for us and the start of the mission \\u2013 we got excited about the prospect of building a business around these principles and to create the postive visceral stimuli and experiences accessible in the broadest way possible. It was also clear that we hoped to for the mission to be a progressive beacon that the local culture can be proud of.<\\/p><p>This was the genus of mamnoon \\u2013 and a fantastic problem for a geek like me to go work on. I don\\u2019t have a culinary background; I am not a foodie or wine connoisseur. I am not a typical sample of the Lebanese or Syrian cultures either, but I am very curious, I am a tinkerer and have a lot of humility to try new things and fail at them and I have no issues calling for help if I need it.<\\/p>\"}},\"503\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"497\"],\"position\":\"right\"}},\"504\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>The mamnoon project was a complete collaboration between Racha and me entering into many areas that we have never been before, and like every other project I have been in, mamnoon is a headlong full contact affair \\u2013 made more intense by the fact that Racha is fully in it as well. This is a new and intense family dynamic. We both bring it home and live it day and night. It has helped us do better for mamnoon in a very natural way, and has added a dimension of authenticity that is unparalleled.<\\/p><p>I am talking about mamnoon in very personal way, but what really makes it relevant and vibrant to all of us today is the team that has gelled behind the mission. We are simply blessed to have some of the most talented individuals in the industry believe in what we are trying to do and to have taken on the mission as their own. This is a testament that what we have lived and believe in is universal. The excitement, passion and drive we see in the staff translates to amazing guest experiences and a net cultural transfer \\u2013 all of it for the better.<\\/p><p>As the main geek at mamnoon my work is endless, there is a lot I need to do tinkering here and there \\u2013 helping on the technology, working on processes and learning what it is that we can do to make the mamnoon experience universally compelling. If you come by one day and see me around with a laptop, measuring tape, on top of a ladder, under a piece of equipment, or talking to a guest- don\\u2019t be surprised, I\\u2019m just geeking out. <\\/p><p>Wassef<\\/p>\"}}}}}', '2014-09-10 22:12:23', '2014-09-10 22:12:23', '8214ca16-b344-4fab-957b-78d6d4386ba2');
INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `num`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('176', '509', '6', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"400\",\"title\":\"Spotlight: Lounge Screens\",\"slug\":\"spotlight-lounge-screens\",\"postDate\":1396594800,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"\",\"48\":\"\",\"46\":\"\",\"47\":\"\",\"39\":{\"new1\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"505\"],\"position\":\"full\"}},\"new2\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>They do more than provide some intimacy and sound-buffering in our lounge: the laser cut poplar wood screens built for us by Seattle\\u2019s immensely talented graypants studios are an integral part of the aesthetic and flow of our restaurant. <em>Mashrabiya<\\/em> are latticed wood screens that are a common fixture in Middle Eastern homes and are designed for a combination of shade, privacy, and air circulation. Our screens take elements of the traditional <em>mashrabiya<\\/em> and add a Northwest flair-- the varying levels of opacity created by the star cut-outs were inspired by the patterns of light and shadows in a forest of trees. The wooden screens are a beautiful embodiment of the balance between old and new world, tradition and innovation, and beauty and function found at mamnoon.<\\/p>\"}},\"new3\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"506\",\"507\"],\"position\":\"center\"}},\"new4\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<hr><p>Fun fact: the leftover cut-outs from the screens are used as holders for specials and announcements on table throughout the restaurant.<\\/p>\"}},\"new5\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"508\"],\"position\":\"center\"}},\"new6\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>Check out&nbsp;<a href=\\\"http:\\/\\/www.graypants.com\\/project\\/mamnoon-screens\\/?lang=us\\\" target=\\\"_blank\\\">graypant\\u2019s website<\\/a>&nbsp;for more images of the screens and details on other awesome projects they have going on.<\\/p>\"}}}}}', '2014-09-10 22:18:25', '2014-09-10 22:18:25', 'dabc3e7a-0b63-468a-a4ff-af95b1cd3d78');
