INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `num`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('183', '532', '6', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"400\",\"title\":\"What\'s the Deal With Drink Service?\",\"slug\":\"whats-the-deal-with-drink-service\",\"postDate\":1391155200,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"\",\"48\":\"\",\"46\":\"\",\"47\":\"\",\"39\":{\"new1\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"530\"],\"position\":\"right\"}},\"new2\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>Is it lunch? Is it happy hour? Is it okay if I want to just sit and drink alone?<\\/p><p>These are all questions that may be swirling through your head as you see blurbs and announcements about mamnoon\'s new \\\"Drink Service.\\\" But, really, the semantics don\'t matter that much - the takeaway is that we\'re expanding our services during what is typically the afternoon lull and you should get really excited about that.<\\/p><p>We\'ve coined it Drink Service in homage to the tea and coffee experience that is a staple of Middle Eastern hospitality. While it\'s not a happy hour per se, we\'ve got banging deals on drinks (both boozy and boring), food, and plates of delicious off-menu treats that come gratis with drinks. House-roasted nuts, Iranian pickled vegetables, a confection or two... think tapas-style: order a drink and you get a little sweet or savory nibble so you don\'t get sloshed on our community table.<\\/p><p>We\'re just trying to spread the love a little farther. Drink Service is conducted in the front of the restaurant at our community table to facilitate socialization and is a tribute of sorts to the warmth of Middle Eastern dining. We\'re trying to create a casual environment for friends to come in and enjoy the mamnoon energy with a tasty drink and delicious food.<\\/p><p>So stop by between 2:30 and 5:30 Tuesday- Sunday to see what the buzz is about. And maybe get one of your own.<\\/p>\"}},\"new3\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"531\"],\"position\":\"center\"}}}}}', '2014-09-10 22:49:03', '2014-09-10 22:49:03', '9209c289-6e48-41f8-ac53-4bded98a529a');
