rong><\\/p><p>\\r\\n\\t<strong><em>pastry<\\/em><\\/strong><\\/p><p>\\r\\n\\tfromage de chevre<\\/p><p>\\r\\n\\t<em>fresh goat cheese, parsley, chive, tarragon<\\/em><\\/p><p>\\r\\n\\t\\u00e9paule d\'agneau confite<\\/p><p>\\r\\n\\t<em>lamb shoulder confit, warm spices, onion<\\/em><\\/p><p>\\r\\n\\t<em><br>\\r\\n\\t<\\/em><\\/p><p>\\r\\n\\t<strong>l\\u00e9gume<\\/strong><\\/p><p>\\r\\n\\t<strong><em>vegetable<\\/em><\\/strong><\\/p><p>\\r\\n\\ttajine<\\/p><p>\\r\\n\\t<em>seven vegetable tagine, saffron, ginger, hand-rolled couscous, smen, fresh buttermilk<\\/em><\\/p><p>\\r\\n\\t<em><br>\\r\\n\\t<\\/em><\\/p><p>\\r\\n\\t<strong>poisson<\\/strong><\\/p><p>\\r\\n\\t<em><strong>fish<\\/strong><\\/em><\\/p><p>\\r\\n\\tbar r\\u00f4ti<\\/p><p>\\r\\n\\t<em>roasted sea bass, chermoula, herb salad<\\/em><\\/p><p>\\r\\n\\t<em><br>\\r\\n\\t<\\/em><\\/p><p>\\r\\n\\t<strong>friandises<\\/strong><\\/p><p>\\r\\n\\t<strong><em>treats<\\/em><\\/strong><\\/p><p>\\r\\n\\tgazelle horns<\\/p><p>\\r\\n\\ttahini cookies<\\/p><p>\\r\\n\\ttangerines<\\/p><hr id=\\\"horizontalrule\\\">\"}},\"540\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>Dinner is $65 per person and does not include gratuity, tax and beverage. We apologize for the inconvenience but we are unable to make substitutions as it is a set menu. Reservations are required for the event as space is limited. Please note that because of the communal nature of the meal, parties less than 8 may be grouped at a table with others. If your party prefers to be at a private table please make a note on your reservation and we will try our best to accommodate, but no promises. Reservations can be made at <a href=\\\"http:\\/\\/mamnoonrestaurant.com\\/\\\">http:\\/\\/mamnoonrestaurant.com<\\/a> or at 206.906.9606.<\\/p><p>Mamnoon to you!<\\/p>\"}}}}}', '2014-09-10 23:01:01', '2014-09-10 23:01:01', '0f383b7f-2929-4f96-8555-7099620ddf85');
