<\\/strong><\\/p><p>\\r\\n\\t<strong><em>pastry<\\/em><\\/strong><\\/p><p>\\r\\n\\tfromage de chevre<\\/p><p>\\r\\n\\t<em>fresh goat cheese, parsley, chive, tarragon<\\/em><\\/p><p>\\r\\n\\t\\u00e9paule d\'agneau confite<\\/p><p>\\r\\n\\t<em>lamb shoulder confit, warm spices, onion<\\/em><\\/p><p>\\r\\n\\t<em><br>\\r\\n\\t<\\/em><\\/p><p>\\r\\n\\t<strong>l\\u00e9gume<\\/strong><\\/p><p>\\r\\n\\t<strong><em>vegetable<\\/em><\\/strong><\\/p><p>\\r\\n\\ttajine<\\/p><p>\\r\\n\\t<em>seven vegetable tagine, saffron, ginger, hand-rolled couscous, smen, fresh buttermilk<\\/em><\\/p><p>\\r\\n\\t<em><br>\\r\\n\\t<\\/em><\\/p><p>\\r\\n\\t<strong>poisson<\\/strong><\\/p><p>\\r\\n\\t<em><strong>fish<\\/strong><\\/em><\\/p><p>\\r\\n\\tbar r\\u00f4ti<\\/p><p>\\r\\n\\t<em>roasted sea bass, chermoula, herb salad<\\/em><\\/p><p>\\r\\n\\t<em><br>\\r\\n\\t<\\/em><\\/p><p>\\r\\n\\t<strong>friandises<\\/strong><\\/p><p>\\r\\n\\t<strong><em>treats<\\/em><\\/strong><\\/p><p>\\r\\n\\tgazelle horns<\\/p><p>\\r\\n\\ttahini cookies<\\/p><p>\\r\\n\\ttangerines<\\/p><hr id=\\\"horizontalrule\\\">\"}},\"540\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>Dinner is $65 per person and does not include gratuity, tax and beverage. We apologize for the inconvenience but we are unable to make substitutions as it is a set menu. Reservations are required for the event as space is limited. Please note that because of the communal nature of the meal, parties less than 8 may be grouped at a table with others. If your party prefers to be at a private table please make a note on your reservation and we will try our best to accommodate, but no promises. Reservations can be made at <a href=\\\"http:\\/\\/mamnoonrestaurant.com\\/\\\">http:\\/\\/mamnoonrestaurant.com<\\/a> or at 206.906.9606.<\\/p><p>Mamnoon to you!<\\/p>\"}}}}}', '2014-09-10 23:01:53', '2014-09-10 23:01:53', 'b0f9fcf8-529d-4680-9fb3-b35be0dbfa04');
INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `num`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('195', '509', '6', '1', 'en_us', '4', '', '{\"typeId\":\"6\",\"authorId\":\"400\",\"title\":\"Spotlight: Lounge Screens\",\"slug\":\"spotlight-lounge-screens\",\"postDate\":1396594800,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"\",\"48\":\"\",\"46\":\"\",\"47\":\"\",\"39\":{\"510\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"505\"],\"position\":\"full\"}},\"511\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>They do more than provide some intimacy and sound-buffering in our lounge: the laser cut poplar wood screens built for us by Seattle\\u2019s immensely talented graypants studios are an integral part of the aesthetic and flow of our restaurant. <em>Mashrabiya<\\/em> are latticed wood screens that are a common fixture in Middle Eastern homes and are designed for a combination of shade, privacy, and air circulation. Our screens take elements of the traditional <em>mashrabiya<\\/em> and add a Northwest flair-- the varying levels of opacity created by the star cut-outs were inspired by the patterns of light and shadows in a forest of trees. The wooden screens are a beautiful embodiment of the balance between old and new world, tradition and innovation, and beauty and function found at mamnoon.<\\/p>\"}},\"512\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"506\"],\"position\":\"center\"}},\"517\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"516\"],\"position\":\"center\"}},\"513\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>Fun fact: the leftover cut-outs from the screens are used as holders for specials and announcements on table throughout the restaurant.<\\/p>\"}},\"514\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"508\"],\"position\":\"center\"}},\"515\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>Check out&nbsp;<a href=\\\"http:\\/\\/www.graypants.com\\/project\\/mamnoon-screens\\/?lang=us\\\" target=\\\"_blank\\\">graypant\\u2019s website<\\/a> for more images of the screens and details on other awesome projects they have going on.<\\/p>\"}}}}}', '2014-09-10 23:06:43', '2014-09-10 23:06:43', '1e6c32db-f630-43fb-b471-c1452892d6fc');
