INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `num`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('312', '776', '6', '394', 'en_us', '2', '', '{\"typeId\":\"6\",\"authorId\":\"394\",\"title\":\"mamnoon superbowl meal @ home\",\"slug\":\"mamnoon-superbowl-meal-home\",\"postDate\":1422475320,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"\",\"48\":\"\",\"46\":\"\",\"47\":\"\",\"39\":{\"new1\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"777\"],\"position\":\"left\"}},\"new3\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>Go Hawks!<\\/p><p>The hawks making the superbowl, again, is one of the good reasons for us to close our dinner service. We are so proud of the team and want to root for them all the way. &nbsp;As a result we will be closing at 2:30 pm on Sunday Feb  1st and then.<\\/p><p>if you are not lucky to be there in person,  we can help you have the very best seahawks party at home. check out  this incredible take home or delivery menu and put your orders in soon -  we don\'t want you to miss out on shish taouk \\\"hawk\\\" wings.&nbsp; These are chicken wings marinated in our famous shish taouk marinade served in a bucket with a selection of our best dips.&nbsp; This meal will set a new high bar for superbowl food and make you the most seahawk of hosts.&nbsp;<\\/p><p>Please put your orders in early by calling in at 206 906 9606 and ask for the superbowl special and what time you will be picking up.&nbsp; Delivery is also available via<\\/p><p>https:\\/\\/www.trycaviar.com\\/seattle\\/mamnoon-628<\\/p><p>Wassef<\\/p><p>ps.&nbsp; we will be ordering a couple for a party we\'re crashing :)<\\/p>\"}}}}}', '2015-01-28 20:12:26', '2015-01-28 20:12:26', '0c20c7ff-435c-4ffe-8f52-584f80ca0cee');
