INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `num`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('347', '820', '6', '394', 'en_us', '2', '', '{\"typeId\":\"6\",\"authorId\":\"819\",\"title\":\"Art at mamnoon\",\"slug\":\"art-at-mamnoon-1\",\"postDate\":1427871600,\"expiryDate\":null,\"enabled\":0,\"fields\":{\"38\":\"\",\"48\":\"\",\"46\":\"\",\"47\":\"\",\"39\":{\"new2\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"821\"],\"position\":\"center\"}},\"new1\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>\\r\\n\\tArt manifests itself in many ways at mamnoon, in the food, in the music and in the art. Our most prominent piece, an installation of thirty fiberglass chickens, hangs over the dining room. \\\"Simorgh\\\" is the work of Persian sculptor \\r\\n\\t<strong>Nastaran Safaei<\\/strong>. Maintaining an air of playfulness and levity, the artist has instilled a double meaning in \\\"Simorgh.\\\" It derives its influence primarily from the character of the same name in Farid al-Din Attar\'s twelfth-century poem \\\"The Conference of the Birds,\\\" which follows a flock as they travel through the many valleys of life as they search for illustrious King of the Birds. Safaei plays on the name further: Separately, the syllables of \\\"Simorgh\\\" translate to thirty (\'si\') birds (\'morgh\').\\r\\n<\\/p>\"}},\"new4\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"822\"],\"position\":\"center\"}},\"new3\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>\\r\\n\\tSafaei\'s \\\"Simorgh\\\" adds an air of mysticism and tradition to the atmosphere at mamnoon, acting simultaneously as compliment and juxtaposition to mamnoon\'s collection, which includes \\r\\n\\t<strong>Hassan Hajjaj<\\/strong>\'s<i>Ya Amina<\\/i>, a colorful portrait of a strong and brightly-dressed young woman. Unafraid of breaking boundaries, Hajjaj employs a boundless color palette and wide-reaching use of mediums to create portraits that both embody and empower the people of his native Morocco.\\r\\n<\\/p>\"}}}}}', '2015-04-01 20:39:44', '2015-10-21 23:14:17', '3d42bdad-c16f-4801-9d04-1bc81776ce24');
INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `num`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('348', '820', '6', '394', 'en_us', '3', '', '{\"typeId\":\"6\",\"authorId\":\"819\",\"title\":\"Art at mamnoon\",\"slug\":\"art-at-mamnoon-1\",\"postDate\":1427922000,\"expiryDate\":null,\"enabled\":0,\"fields\":{\"38\":\"\",\"48\":\"\",\"46\":\"\",\"47\":\"\",\"39\":{\"823\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"821\"],\"position\":\"center\"}},\"824\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>\\r\\n\\tArt manifests itself in many ways at mamnoon, in the food, in the music and in the art. Our most prominent piece, an installation of thirty fiberglass chickens, hangs over the dining room. \\\"Simorgh\\\" is the work of Persian sculptor \\r\\n\\t<strong>Nastaran Safaei<\\/strong>. Maintaining an air of playfulness and levity, the artist has instilled a double meaning in \\\"Simorgh.\\\" It derives its influence primarily from the character of the same name in Farid al-Din Attar\'s twelfth-century poem \\\"The Conference of the Birds,\\\" which follows a flock as they travel through the many valleys of life as they search for illustrious King of the Birds. Safaei plays on the name further: Separately, the syllables of \\\"Simorgh\\\" translate to thirty (\'si\') birds (\'morgh\').\\r\\n<\\/p>\"}},\"825\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"822\"],\"position\":\"center\"}},\"826\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>\\r\\n\\tSafaei\'s \\\"Simorgh\\\" adds an air of mysticism and tradition to the atmosphere at mamnoon, acting simultaneously as compliment and juxtaposition to mamnoon\'s collection, which includes \\r\\n\\t<strong>Hassan Hajjaj<\\/strong>\'s<i>Ya Amina<\\/i>, a colorful portrait of a strong and brightly-dressed young woman. Unafraid of breaking boundaries, Hajjaj employs a boundless color palette and wide-reaching use of mediums to create portraits that both embody and empower the people of his native Morocco.\\r\\n<\\/p>\"}}}}}', '2015-04-01 20:41:12', '2015-10-21 23:14:17', 'cd0d7c79-6cba-41c8-8cc6-a717398f5698');
INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `num`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('349', '829', '6', '394', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"819\",\"title\":\"Art at mamnoon\",\"slug\":\"art-at-mamnoon-2\",\"postDate\":1433613600,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"\",\"48\":\"\",\"46\":\"\",\"47\":\"\",\"39\":{\"new1\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>\\r\\n\\tArt at mamnoon\\r\\n<\\/p><p>\\r\\n\\tOur collection has grown! We are excited to feature two pieces from Los Angeles artists \\r\\n\\t<a href=\\\"http:\\/\\/www.davisanddavis.org\\/gallery.html\\\" target=\\\"_blank\\\">Davis and Davis<\\/a> from their \\\"Little Talents\\\" collection. \\\"Tattoo Baby\\\" and \\\"Whirly Girl\\\" are photographs that employ a rich color palette while using found materials to create images that are both aesthetically pleasing and mentally perplexing. In \\\"Whirly Girl,\\\" the doll is depicted as \\r\\n\\t<i>literally<\\/i> having the world on a string, while \\\"Tattoo Baby\\\" shows a swaddled figurine covered in henna designs. Needless to say, these pieces leave much up to the imagination.\\r\\n<\\/p>\"}},\"new8\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"827\"],\"position\":\"center\"}},\"new3\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>\\r\\n\\t For me, \\\"Whirly Girl\\\" is particularly striking, because of its highly-charged duality. As part of a generation who feels like they are entitled to the world, my first read was that the artists\' intentions were to convey that this notion of global possessiveness is a truly epic farce, begging to be mocked. However, in light of the mission of mamnoon, an entirely different message can be begged. By placing the entire world within the grasp of this tiny girl, every corner of the globe is accessible for us to explore, embrace and taste. Ultimately, interpretation is a choice, and I am going to choose the positive.\\r\\n<\\/p>\"}},\"new9\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"828\"],\"position\":\"center\"}},\"new6\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>\\r\\n\\tAs far as \\\"Tattoo Baby\\\" goes, I would love to think that the artists were depicting the next generation of Capitol Hill hipsters, but something tells me I am a little off in that. The image of a blonde-haired baby covered in tattoos is highly imaginative, unique and totally unheard of. Seeing it for the first time brought back memories of my first dining experience at mamnoon, that \\\"Holy H*&amp;!\\\" moment of culinary bliss that comes with trying a dish that blends two things together to create a union that you never would have even considered before. Mamnoon is filled with all of these juicy combinations, from the food on the plates to the art on the walls, and I can\'t wait to see what happens next.\\r\\n<\\/p><p>\\r\\n\\tCome check them out, they can be found deep in the main dining hall, right next the glass kitchen wall. We\'d love to hear your interpretation.\\r\\n<\\/p><p>\\r\\n\\t<br>\\r\\n<\\/p>\"}}}}}', '2015-06-06 17:58:40', '2015-10-21 23:14:17', 'bbe7761c-03cb-47cf-9180-df027e7c8a47');
INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `num`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('350', '836', '6', '394', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"819\",\"title\":\"mamnoonee of the minute: Elad\",\"slug\":\"mamnoonee-of-the-minute-elad\",\"postDate\":1435338000,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"\",\"48\":\"\",\"46\":\"\",\"47\":\"\",\"39\":{\"new1\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"835\"],\"position\":\"center\"}},\"new2\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>\\r\\n\\tCommunity is everything at mamnoon. And it all starts with our staff.\\r\\n<\\/p><p>\\r\\n\\t<br>\\r\\n<\\/p><p>\\r\\n\\tSetting the precedent for hard work and flexibility at Mamnoon, Elad wears the many hats of a bartender, server and Mamnoon Street \\\"Window Dude.\\\" Out of breath? Me too. Elad is there to help with whatever, whenever and wherever. His unparalleled sense of work ethic and unbreakable \\\"can-do\\\" attitude help keep Mamnoon ticking.\\r\\n<\\/p><p>\\r\\n\\tOutside of Mamnoon, you can find Elad engrossed in his art. Specializing in typography and street art, Elad\'s pieces capture life in brilliant color.\\r\\n<\\/p><p>\\r\\n\\tWhatever palette he\'s perfecting, be that color tones or quinoa tabbouleh, Elad can always be counted on to give us his best, smiling all the way.\\r\\n<\\/p><p>\\r\\n\\tMamnoon to you, Elad!\\r\\n<\\/p>\"}}}}}', '2015-06-26 17:10:13', '2015-10-21 23:14:17', '476ee0ee-4483-424f-ba15-5c6a440b29e8');
INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `num`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('351', '836', '6', '394', 'en_us', '2', '', '{\"typeId\":\"6\",\"authorId\":\"819\",\"title\":\"mamnoonee of the minute: Elad\",\"slug\":\"mamnoonee-of-the-minute-elad\",\"postDate\":1435338000,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"\",\"48\":\"\",\"46\":\"\",\"47\":\"\",\"39\":{\"837\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"835\"],\"position\":\"center\"}},\"838\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>\\r\\n\\tCommunity is everything at mamnoon. And it all starts with our staff.\\r\\n<\\/p><p>\\r\\n\\t<br>\\r\\n<\\/p><p>\\r\\n\\tSetting the precedent for hard work and flexibility at mamnoon, Elad wears the many hats of a bartender, server and mamnoon Street \\\"Window Dude.\\\" Out of breath? Me too. Elad is there to help with whatever, whenever and wherever. His unparalleled sense of work ethic and unbreakable \\\"can-do\\\" attitude help keep mamnoon ticking.\\r\\n<\\/p><p>\\r\\n\\tOutside of mamnoon, you can find Elad engrossed in his art. Specializing in typography and street art, Elad\'s pieces capture life in brilliant color.\\r\\n<\\/p><p>\\r\\n\\tWhatever palette he\'s perfecting, be that color tones or quinoa tabbouleh, Elad can always be counted on to give us his best, smiling all the way.\\r\\n<\\/p><p>mamnoon to you, Elad!\\r\\n<\\/p>\"}}}}}', '2015-06-26 17:11:27', '2015-10-21 23:14:17', 'ed0b80d3-4598-4c86-98a6-ba6b55dcfddc');
