INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `num`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('429', '921', '6', '395', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"395\",\"title\":\"Soup for Syria Fundraiser,  Thursday October 22, 2015\",\"slug\":\"soup-for-syria-fundraiser-thursday-october-22-2015\",\"postDate\":1444275502,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"\",\"48\":\"\",\"46\":\"\",\"47\":\"\",\"39\":{\"new1\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>Dominating the news from around the world, we are troubled by the plight of Syrian refugees fleeing their country in massive numbers- taking little to nothing of their home and possessions and striving to find a country in which to build a better life.<br>On Thursday, October 22nd, we will partner with local retailer, Elliot Bay Book Company, to organize a fundraising event in the restaurant with 100% of the money designated toward 3 organizations: <a href=\\\"http:\\/\\/www.mercycorps.org\\/countries\\/syria\\\">Mercy Corps<\\/a>,   <a href=\\\"http:\\/\\/www.msf.org\\/syria\\\">Medecins Sans Fronti\\u00e8res<\\/a> and <a href=\\\"http:\\/\\/www.karamfoundation.org\\/\\\">Karam Foundation<\\/a>. We hope that you will come out to support them. <br><\\/p><p>Inspired by the cookbook, <a href=\\\"http:\\/\\/www.soupforsyria.com\\/book.php\\\">Soup for Syria<\\/a>, from Lebanese author, Barbara Massaad, Chef Jason Stratton has enlisted support from Seattle\\u2019s culinary community.<br><\\/p><p>In the dining room, Jason and friends will construct a fantastic, multi-course dinner with beverage pairings. The dinner will include a copy of Barbara\\u2019s book.  The cost of the dinner is $250 per person (+ tax and gratuity).<br><\\/p><p>Half-dozen chefs will contribute a soup for an all-you-can-eat, Soup, Bread and Beverage for $35, available at the communal table and Mamnoon Street. Seating will be on a first come, first served basis.<br>{Please note that these will be the only menus offered on that evening.}<\\/p><p>plan to come in for the soup or reserve now by calling (206) 906 9606 or emailing reservations@mamnoonrestaurant.com<\\/p><p>mamnoon<br><\\/p>\"}},\"new2\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"920\"],\"position\":\"right\"}}}}}', '2015-10-08 03:38:22', '2015-10-08 03:38:22', 'ca6fe5bf-5107-44f1-9283-cf5324c26c53');
INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `num`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('430', '925', '6', '395', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"395\",\"title\":\"mamnoon in the news\",\"slug\":\"mamnoon-in-the-news\",\"postDate\":1444275790,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"\",\"48\":\"\",\"46\":\"\",\"47\":\"\",\"39\":{\"new1\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"By now, we hope that you\\u2019ve read the news that Chef Jason Stratton, formerly of Spinasse and Artusi, has come on board to lead the kitchen and front of house at mamnoon. He has also brought on talented pastry chef, Carrie Mashaney to join him, along with Executive Sous Chef, David Gurewitz.  Needless to say, we\\u2019re delighted to have them leading our culinary team.<p><br><\\/p><p>Additionally, you may have seen that we are expanding mamnoon\\u2019s experience to South Lake Union.  We are really excited about these projects and we\\u2019ll make sure that you\\u2019ll be the first to get the full scoop just as soon as possible.  We think you\\u2019ll be delighted with these new food and beverage options.<\\/p>\"}},\"new2\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"924\"],\"position\":\"right\"}}}}}', '2015-10-08 03:43:10', '2015-10-08 03:43:10', 'f36bb52a-618b-415a-a222-52e569e4dc72');
INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `num`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('431', '921', '6', '395', 'en_us', '2', '', '{\"typeId\":\"6\",\"authorId\":\"395\",\"title\":\"Soup for Syria Fundraiser,  Thursday October 22, 2015\",\"slug\":\"soup-for-syria-fundraiser-thursday-october-22-2015\",\"postDate\":1444276200,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"\",\"48\":\"\",\"46\":\"\",\"47\":\"\",\"39\":{\"922\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>Dominating the news from around the world, we are troubled by the plight of Syrian refugees fleeing their country in massive numbers- taking little to nothing of their home and possessions and striving to find a country in which to build a better life.<br>On Thursday, October 22nd, we will partner with local retailer, Elliot Bay Book Company, to organize a fundraising event in the restaurant with 100% of the money designated toward 3 organizations: <a href=\\\"http:\\/\\/www.mercycorps.org\\/countries\\/syria\\\">Mercy Corps<\\/a>,   <a href=\\\"http:\\/\\/www.msf.org\\/syria\\\">Medecins Sans Fronti\\u00e8res<\\/a> and <a href=\\\"http:\\/\\/www.karamfoundation.org\\/\\\">Karam Foundation<\\/a>. We hope that you will come out to support them. <br><\\/p><p>Inspired by the cookbook, <a href=\\\"http:\\/\\/www.soupforsyria.com\\/book.php\\\">Soup for Syria<\\/a>, from Lebanese author, Barbara Massaad, Chef Jason Stratton has enlisted support from Seattle\\u2019s culinary community.<br><\\/p><p>In the dining room, Jason and friends will construct a fantastic, multi-course dinner with beverage pairings. The dinner will include a copy of Barbara\\u2019s book.  The cost of the dinner is $250 per person (+ tax and gratuity).<br><\\/p><p>Half-dozen chefs will contribute a soup for an all-you-can-eat, Soup, Bread and Beverage for $35, available at the communal table and Mamnoon Street. Seating will be on a first come, first served basis.<br>{Please note that these will be the only menus offered on that evening.}<\\/p><p>plan to come in for the soup or reserve now by calling (206) 906 9606 or emailing reservations@mamnoonrestaurant.com<\\/p><p>mamnoon<br><\\/p>\"}},\"923\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"920\"],\"position\":\"right\"}}}}}', '2015-10-08 03:43:55', '2015-10-08 03:43:55', '9f2fd63e-a795-4424-84cd-b63c85664b85');
INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `num`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('432', '925', '6', '395', 'en_us', '2', '', '{\"typeId\":\"6\",\"authorId\":\"395\",\"title\":\"mamnoon in the news\",\"slug\":\"mamnoon-in-the-news\",\"postDate\":1444275780,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"\",\"48\":\"\",\"46\":\"\",\"47\":\"\",\"39\":{\"927\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"924\"],\"position\":\"right\"}},\"926\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>By now, we hope that you\\u2019ve read the news that Chef Jason Stratton, formerly of Spinasse and Artusi, has come on board to lead the kitchen and front of house at mamnoon. He has also brought on talented pastry chef, Carrie Mashaney to join him, along with Executive Sous Chef, David Gurewitz.  Needless to say, we\\u2019re delighted to have them leading our culinary team.<\\/p><p><br><\\/p><p>Additionally, you may have seen that we are expanding mamnoon\\u2019s experience to South Lake Union.  We are really excited about these projects and we\\u2019ll make sure that you\\u2019ll be the first to get the full scoop just as soon as possible.  We think you\\u2019ll be delighted with these new food and beverage options.<\\/p>\"}}}}}', '2015-10-08 03:45:14', '2015-10-08 03:45:14', '7ed90196-8966-4558-a020-94fb00bb330c');
