and Beverage for $35, available at the communal table and Mamnoon Street. Seating will be on a first come, first served basis.<br>{Please note that these will be the only menus offered on that evening.}<\\/p><p>plan to come in for the soup or reserve now by calling (206) 906 9606 or emailing reservations@mamnoonrestaurant.com<\\/p><p>mamnoon<br><\\/p>\"}}}}}', '2015-10-08 03:45:48', '2015-10-08 03:45:48', 'e43d9806-a641-4972-b60a-6eae77312db5');
