INSERT INTO `craft_searchindex` (`elementId`, `attribute`, `fieldId`, `locale`, `keywords`) VALUES ('2', 'field', '2', 'en_us', ' it s true this site doesn t have a whole lot of content yet but don t worry our web developers have just installed the cms and they re setting things up for the content editors this very moment soon mamnoon craft dev will be an oasis of fresh perspectives sharp analyses and astute opinions that will keep you coming back again and again ');
