INSERT INTO `craft_searchindex` (`elementId`, `attribute`, `fieldId`, `locale`, `keywords`) VALUES ('2', 'field', '46', 'en_us', ' modern union of lebanese syrian persian cuisines lebanese and syrian street foods ');
INSERT INTO `craft_searchindex` (`elementId`, `attribute`, `fieldId`, `locale`, `keywords`) VALUES ('2', 'field', '37', 'en_us', ' our story screens 1 food an essential part of all family and social interactions in the middle east where people grow up with intense flavors colorful vibrant foods fresh from the marketplace prepared simply and with a lot of passion aromatic herbs fill the streets and a spirit of warmth and generosity exudes welcome at any table here at mamnoon we share these strengths brought with us from lebanon and syria to the new world of seattle where modern curiosity compassion progressive values and tolerance are paving the way for harmonious integration and celebration of cultures and flavors racha racha bio pic owner racha haroun was born in london england to a syrian father and iranian mother racha came with her family to houston texas from damascus in 1982 where she attended college and met her husband wassef racha grew up in a household where hospitality was prized and where both cuisines and palates were equally valued and integrated racha is deeply involved in the cultural community of seattle and is a crucial part of the palate menu development and creative process behind the mamnoon aesthetic wassef wassefracha owner wassef haroun was born in syria and raised in lebanon before moving to the united states for school after leaving a career in technology and computer science wassef turned to mamnoon as an experiment to bring the food and traditions of the levant to an american audience and to bridge the apparent gaps between the two cultures he inhabits true to his geek background wassef has his hands in innumerable projects big and small around the restaurant in order to make the mamnoon experience universally compelling the team seattlemet secret supper none of this would be possible without our spectacular team ');
