INSERT INTO `craft_searchindex` (`elementId`, `attribute`, `fieldId`, `locale`, `keywords`) VALUES ('484', 'field', '39', 'en_us', ' mamnoon has recently added art to our dining room to showcase artists of the middle east and africa our walls speak to the power of women love and seduction mouneer center this image by mouneer al sharaani can be translated to enchantment is in the the colors the melodies the dew drops the fragrances and the flowers the artist is a syrian calligrapher designer and print maker living and working in cairo al sharaani gave birth to a new era of contemporary arab calligraphy through the synthesis of traditional techniques and modern styles and has received international recognition for his revitalization of the medium montiero center model turned photographer fabrice monteiro is an emerging artist working in the fields of photojournalism fashion photography and portraiture born to a beninese father and belgian mother his childhood straddled the diverse cultural lines often represented in his work monteiro s images carry the weight of modernity and tradition and force the viewer to confront the complex and often uncomfortable aesthetics of race culture and imperialism this image from his signares series explores the role of cloth and clothing during african colonization and their subsequent meaning in an era of westernization powerful signarese women were often the official wives of european colonizers for the duration of their stay often celebrated for their beauty and business mind these women played an important role in the socio economic development of senegal babak1 center babak 2 center these photographs by iranian photographer babak kazemi are a contemporary interpretation of the legend of shirin and farhad as the story goes farhad was a stonemason who was in love with the beautiful shirin who was also desired by the powerful king khosrow shirin knew of farhad s love and used it to make the king jealous king khosrow attempted to get rid of farhad by ordering him to complete an impossible task to win shirin s hand he must move a mountain farhad s love proves to be stronger than either the king or shirin hadimagined and he takes on the task with zeal amazed at the reports of farhad s progress shirin travel to the mountain to see for herself after the long journey though she faints with fatigue and farhad places both shirin and her horse on his shoulders and carries them back to the palace kazemi revisits this 16th century tragedy to comment on the contemporary struggle of lovers who must leave their homeland to find the freedom to love as they choose for the artist the story reveals the message that love can overcome even the most difficult situations hajjaj center hassan hajjaj who was born in morocco and raised in london is a master of multiple mediums including furniture fashion interior and record album covers hajjaj synthesized these all into a series of sensational photo portraits in kesh angels these transcultural and trans medium images depict a distinct subculture of young moroccan women who work as henna tattoo artists and travel marrakesh on motorbike with pride and ease the women pose with their bikes wearing veils and abayas against vivid backdrops these photos are a jarring mix of old and new east and west global and local hajjaj plays with and upends stereotypes presenting his subjects as both traditional and defiantly modern which infuses his photos with electrifying tension ');
