INSERT INTO `craft_searchindex` (`elementId`, `attribute`, `fieldId`, `locale`, `keywords`) VALUES ('489', 'field', '40', 'en_us', ' model turned photographer fabrice monteiro is an emerging artist working in the fields of photojournalism fashion photography and portraiture born to a beninese father and belgian mother his childhood straddled the diverse cultural lines often represented in his work monteiro s images carry the weight of modernity and tradition and force the viewer to confront the complex and often uncomfortable aesthetics of race culture and imperialism this image from his signares series explores the role of cloth and clothing during african colonization and their subsequent meaning in an era of westernization powerful signarese women were often the official wives of european colonizers for the duration of their stay often celebrated for their beauty and business mind these women played an important role in the socio economic development of senegal ');
