INSERT INTO `craft_searchindex` (`elementId`, `attribute`, `fieldId`, `locale`, `keywords`) VALUES ('511', 'field', '40', 'en_us', ' they do more than provide some intimacy and sound buffering in our lounge the laser cut poplar wood screens built for us by seattle s immensely talented graypants studios are an integral part of the aesthetic and flow of our restaurant mashrabiya are latticed wood screens that are a common fixture in middle eastern homes and are designed for a combination of shade privacy and air circulation our screens take elements of the traditional mashrabiya and add a northwest flair the varying levels of opacity created by the star cut outs were inspired by the patterns of light and shadows in a forest of trees the wooden screens are a beautiful embodiment of the balance between old and new world tradition and innovation and beauty and function found at mamnoon ');
