INSERT INTO `craft_searchindex` (`elementId`, `attribute`, `fieldId`, `locale`, `keywords`) VALUES ('532', 'field', '39', 'en_us', ' alexandsam right is it lunch is it happy hour is it okay if i want to just sit and drink alone these are all questions that may be swirling through your head as you see blurbs and announcements about mamnoon s new drink service but really the semantics don t matter that much the takeaway is that we re expanding our services during what is typically the afternoon lull and you should get really excited about that we ve coined it drink service in homage to the tea and coffee experience that is a staple of middle eastern hospitality while it s not a happy hour per se we ve got banging deals on drinks both boozy and boring food and plates of delicious off menu treats that come gratis with drinks house roasted nuts iranian pickled vegetables a confection or two think tapas style order a drink and you get a little sweet or savory nibble so you don t get sloshed on our community table we re just trying to spread the love a little farther drink service is conducted in the front of the restaurant at our community table to facilitate socialization and is a tribute of sorts to the warmth of middle eastern dining we re trying to create a casual environment for friends to come in and enjoy the mamnoon energy with a tasty drink and delicious food so stop by between 2 30 and 5 30 tuesday sunday to see what the buzz is about and maybe get one of your own happy hour center ');
