 of the most rewarding and challenging aspects of the process the most rewarding part is realizing that our hearts are in the right place we are proud of our foods but we wanted to showcase it in a modern northwest setting we noticed that our children are very proud of our achievement and the fact that hard work and perseverance pays off the hardest part has been the constant awareness that our families are living in a tense war situation with a very uncertain future caring and nurturing mamnoon keeps us busy and sane while really highlighting the beautiful aspects of our culture ');
