INSERT INTO `craft_searchindex` (`elementId`, `attribute`, `fieldId`, `locale`, `keywords`) VALUES ('632', 'field', '53', 'en_us', ' executive chef garrett melkonian grew up in his grandparents kitchen surrounded by the flavors and personalities of their native armenia while his cooking career has taken him in many directions including he came to mamnoon because the hospitality found here is a direct reflection of the love and respect he remembers from his childhood garrett strives for the delicate balance of inspiration and authenticity and holds himself and his kitchen to the high standards that come with being ambassadors a cuisine relatively unexplored in the pacific northwest ');
