INSERT INTO `craft_searchindex` (`elementId`, `attribute`, `fieldId`, `locale`, `keywords`) VALUES ('633', 'field', '53', 'en_us', ' mamnoon too chef zack chamberlain was born in the wilds of the green mountains of vermont and made his move from the dish pit to the line as a teenager after attending the culinary institute of america zack came to seattle and began a decades long affair with breads and woodstove ovens zack is the face of our to go window and strives to bring the vibrancy of lebanese street food to a seattle audience ');
