INSERT INTO `craft_searchindex` (`elementId`, `attribute`, `fieldId`, `locale`, `keywords`) VALUES ('830', 'field', '40', 'en_us', ' art at mamnoon our collection has grown we are excited to feature two pieces from los angeles artists davis and davis from their little talents collection tattoo baby and whirly girl are photographs that employ a rich color palette while using found materials to create images that are both aesthetically pleasing and mentally perplexing in whirly girl the doll is depicted as literally having the world on a string while tattoo baby shows a swaddled figurine covered in henna designs needless to say these pieces leave much up to the imagination ');
