INSERT INTO `craft_searchindex` (`elementId`, `attribute`, `fieldId`, `locale`, `keywords`) VALUES ('832', 'field', '40', 'en_us', ' for me whirly girl is particularly striking because of its highly charged duality as part of a generation who feels like they are entitled to the world my first read was that the artists intentions were to convey that this notion of global possessiveness is a truly epic farce begging to be mocked however in light of the mission of mamnoon an entirely different message can be begged by placing the entire world within the grasp of this tiny girl every corner of the globe is accessible for us to explore embrace and taste ultimately interpretation is a choice and i am going to choose the positive ');
