INSERT INTO `craft_searchindex` (`elementId`, `attribute`, `fieldId`, `locale`, `keywords`) VALUES ('921', 'field', '39', 'en_us', ' soup for syria cover right dominating the news from around the world we are troubled by the plight of syrian refugees fleeing their country in massive numbers taking little to nothing of their home and possessions and striving to find a country in which to build a better life on thursday october 22nd we will partner with local retailer elliot bay book company to organize a fundraising event in the restaurant with 100% of the money designated toward 3 organizations mercy corps medecins sans frontieres and karam foundation we hope that you will come out to support them inspired by the cookbook soup for syria from lebanese author barbara massaad chef jason stratton has enlisted support from seattle s culinary community in the dining room jason and friends will construct a fantastic multi course dinner with beverage pairings the dinner will include a copy of barbara s book the cost of the dinner is $250 per person tax and gratuity half dozen chefs will contribute a soup for an all you can eat soup bread and beverage for $35 available at the communal table and mamnoon street seating will be on a first come first served basis please note that these will be the only menus offered on that evening plan to come in for the soup or reserve now by calling 206 906 9606 or emailing reservations mamnoonrestaurant commamnoon ');
